    {
      "lineNumber": 168931,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 168932,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "......"
    },
    {
      "lineNumber": 168933,
      "originalJapaneseLine": "決勝まで残ったチルディと穴奴隷の二人が",
      "translatedEnglishLine": "The two who remained until the finals, Childy and the hole slave,"
    },
    {
      "lineNumber": 168934,
      "originalJapaneseLine": "舞台の上で魔物兵達にアピールしていた。",
      "translatedEnglishLine": "were appealing to the monster soldiers on the stage."
    },
    {
      "lineNumber": 168935,
      "originalJapaneseLine": "完璧な調教を受けた穴奴隷の",
      "translatedEnglishLine": "The hole slave, who had undergone perfect training,"
    },
    {
      "lineNumber": 168936,
      "originalJapaneseLine": "アピールはすさまじく、",
      "translatedEnglishLine": "gave a tremendous appeal,"
    },
    {
      "lineNumber": 168937,
      "originalJapaneseLine": "ライバルであるランスも大興奮。",
      "translatedEnglishLine": "and even Rance, the rival, was extremely excited."
    },
    {
      "lineNumber": 168938,
      "originalJapaneseLine": "対してチルディは見るからにやる気がなかった。",
      "translatedEnglishLine": "On the other hand, Childy clearly showed no enthusiasm."
    },
    {
      "lineNumber": 168939,
      "originalJapaneseLine": "エロく見えるのは誰が見ても穴奴隷の方、",
      "translatedEnglishLine": "Anyone could see that the hole slave looked more erotic,"
    },
    {
      "lineNumber": 168940,
      "originalJapaneseLine": "しかし大会は、チルディが優勝した。",
      "translatedEnglishLine": "but Childy won the tournament."
    },
    {
      "lineNumber": 168941,
      "originalJapaneseLine": "（ま、裏で票操作してるから当然だな……）",
      "translatedEnglishLine": "(Well, it’s obvious since the votes were rigged behind the scenes...)"
    },
    {
      "lineNumber": 168942,
      "originalJapaneseLine": "不正を疑う魔物兵からのブーイングがあったものの、",
      "translatedEnglishLine": "Although there were boos from the monster soldiers suspecting cheating,"
    },
    {
      "lineNumber": 168943,
      "originalJapaneseLine": "一応無事に今回の大会は幕を下ろした。",
      "translatedEnglishLine": "the tournament was safely concluded for now."
    },
    {
      "lineNumber": 168944,
      "originalJapaneseLine": "「はい、ランスさま、優勝しましたわよ」",
      "translatedEnglishLine": "\"Yes, Lord Rance, we won the championship.\""
    },
    {
      "lineNumber": 168945,
      "originalJapaneseLine": "「あーーー……",
      "translatedEnglishLine": "\"Ahhh...\""
    },
    {
      "lineNumber": 168946,
      "originalJapaneseLine": "　うむ……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 168947,
      "originalJapaneseLine": "「なんですの、その気のない返事。",
      "translatedEnglishLine": "\"What’s with that half-hearted reply?"
    },
    {
      "lineNumber": 168948,
      "originalJapaneseLine": "　せっかく恥ずかしい思いも耐えたのに」",
      "translatedEnglishLine": "You endured embarrassment after all.\""
    },
    {
      "lineNumber": 168949,
      "originalJapaneseLine": "「いや、うむ……つまらんな、と……」",
      "translatedEnglishLine": "\"No, hmm... it’s boring, you see...\""
    },
    {
      "lineNumber": 168950,
      "originalJapaneseLine": "「敵を倒すのに面白さなんて必要ありませんわ」",
      "translatedEnglishLine": "\"There’s no need for fun in defeating the enemy.\""
    },
    {
      "lineNumber": 168951,
      "originalJapaneseLine": "「さ、とっととヨシフの邸宅に行って、",
      "translatedEnglishLine": "\"Now, let’s quickly go to Yosif’s mansion,"
    },
    {
      "lineNumber": 168952,
      "originalJapaneseLine": "　敵の将軍をブッ殺しますわよ」",
      "translatedEnglishLine": "and kill the enemy general.\""
    },
    {
      "lineNumber": 168953,
      "originalJapaneseLine": "「もうっ、少しは真面目になさって下さい。",
      "translatedEnglishLine": "\"Jeez, please be a little more serious."
    },
    {
      "lineNumber": 168954,
      "originalJapaneseLine": "　ぷんぷん」",
      "translatedEnglishLine": "Hmph!\""
    },
    {
      "lineNumber": 168955,
      "originalJapaneseLine": "「あー、へいへい……」",
      "translatedEnglishLine": "\"Ahh, yeah yeah...\""
    },
    {
      "lineNumber": 168956,
      "originalJapaneseLine": "「待て待て、不正は良くない」",
      "translatedEnglishLine": "\"Wait, wait, cheating is no good.\""
    },
    {
      "lineNumber": 168957,
      "originalJapaneseLine": "「それに俺様が調教したチルディは完璧だ。",
      "translatedEnglishLine": "\"Besides, the Childy I trained is perfect."
    },
    {
      "lineNumber": 168958,
      "originalJapaneseLine": "　そんなことせんでも優勝だ」",
      "translatedEnglishLine": "She would win even without such things.\""
    },
    {
      "lineNumber": 168959,
      "originalJapaneseLine": "「し、しかし……」",
      "translatedEnglishLine": "\"B-But...\""
    },
    {
      "lineNumber": 168960,
      "originalJapaneseLine": "「毎回優勝となるのは名の知れた",
      "translatedEnglishLine": "\"Winning every time is the mark of a well-known"
    },
    {
      "lineNumber": 168961,
      "originalJapaneseLine": "　調教師でして。はい。",
      "translatedEnglishLine": "trainer, yes."
    },
    {
      "lineNumber": 168962,
      "originalJapaneseLine": "　か、彼に勝つのはその……」",
      "translatedEnglishLine": "B-Beating him is, well...\""
    },
    {
      "lineNumber": 168963,
      "originalJapaneseLine": "「シャラップ。",
      "translatedEnglishLine": "\"Shut up."
    },
    {
      "lineNumber": 168964,
      "originalJapaneseLine": "　俺様は天才だ」",
      "translatedEnglishLine": "I am a genius.\""
    },
    {
      "lineNumber": 168965,
      "originalJapaneseLine": "「はあ……」",
      "translatedEnglishLine": "\"Hah...\""
    },
    {
      "lineNumber": 168966,
      "originalJapaneseLine": "「がははは、では正々堂々と",
      "translatedEnglishLine": "\"Gahaha, then participate in the girls' show fairly and squarely"
    },
    {
      "lineNumber": 168967,
      "originalJapaneseLine": "　ガールズショーに参加して",
      "translatedEnglishLine": "and snatch the victory!\""
    },
    {
      "lineNumber": 168968,
      "originalJapaneseLine": "　優勝をもぎとってくれるわ！」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 168969,
      "originalJapaneseLine": "「だ、大丈夫でしょうか……」",
      "translatedEnglishLine": "\"I-Is that really okay...?\""
    },
    {
      "lineNumber": 168970,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 168971,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "......"
    },
    {
      "lineNumber": 168972,
      "originalJapaneseLine": "ランス達が領主の屋敷を出ると、",
      "translatedEnglishLine": "When Rance and the others left the lord’s mansion,"
    },
    {
      "lineNumber": 168973,
      "originalJapaneseLine": "外で待っていたチルディ達が出迎えた。",
      "translatedEnglishLine": "the Childy group waiting outside greeted them."
    },
    {
      "lineNumber": 168974,
      "originalJapaneseLine": "「お帰りなさいまし、ランスさま。",
      "translatedEnglishLine": "\"Welcome back, Lord Rance."
    },
    {
      "lineNumber": 168975,
      "originalJapaneseLine": "　首尾は如何でした？」",
      "translatedEnglishLine": "How did everything go?\""
    },
    {
      "lineNumber": 168976,
      "originalJapaneseLine": "「うむ、特に問題なくチルディの",
      "translatedEnglishLine": "\"Hmm, without any particular problem, Childy’s"
    },
    {
      "lineNumber": 168977,
      "originalJapaneseLine": "　ガールズショー参加が決まったぞ」",
      "translatedEnglishLine": "participation in the girls’ show has been decided.\""
    },
    {
      "lineNumber": 168978,
      "originalJapaneseLine": "「まあ、そうですの」",
      "translatedEnglishLine": "\"I see, that’s good.\""
    },
    {
      "lineNumber": 168979,
      "originalJapaneseLine": "「うむ、領主は不正優勝を勧めてきたが……",
      "translatedEnglishLine": "\"Hmm, the lord suggested a rigged win, but..."
    },
    {
      "lineNumber": 168980,
      "originalJapaneseLine": "　俺はバッチリ断ってきたぞ」",
      "translatedEnglishLine": "I firmly refused.\""
    }
  ]
}

